import React from 'react'

class Contactcard extends React.Component (props){
    render(){
        return(
            <div className='jokes'>        
                <h3 style = {{display : !this.props.albumId && 'none'}}>Album Id: {this.props.albumId}</h3>
                <h3 style = {{color : !this.props.albumId && 'red'}}>Photo Id: {this.props.id}</h3>
                <img src = {this.props.imgUrl}></img>
            </div>

        )
    }
}



export default Contactcard
